def fn(pprice):
    c = pprice.info_id
    if c.have_finger and not  c.surface_coating.code:
        if  c.finger_au_thick > 3:
            return (3.0,3.0)
        else:
            return (0.0,0.0)           
    elif not c.have_finger and c.surface_coating.code:    
        if 'shen_ag' in c.surface_coating.code:
            return (3.0,3.0)
        elif 'shen_sn' in c.surface_coating.code:
            return (3.0,3.0)
        else:
            return (0.0,0.0) 
    elif  c.have_finger and c.surface_coating.code:
        if   'lead' in c.surface_coating.code  and c.finger_au_thick>3:
            return (7.0,7.0)
        elif c.finger_au_thick>3 and ('shen_ag' in c.surface_coating.code  or 'shen_sn'  in c.surface_coating.code):
            return (6.0,6.0)
        elif  'lead' in c.surface_coating.code :
            return (4.0,4.0)
        elif 'shen_ag' in c.surface_coating.code:
            return (3.0,3.0)
        elif 'shen_sn' in c.surface_coating.code:
            return (3.0,3.0)
        else:
            return (0.0,0.0) 
    elif  not c.have_finger and  not c.surface_coating.code:
        return (0.0,0.0)
    else:
        return (0.0,0.0)

